    public static int searc2h(int[] nums, int target) {
        int lo = 0;
        int hi = nums.length - 1;
        return search(nums, target, lo, hi);
    }

    public static int search (int[] nums, int target, int lo, int hi) {
        int mid = lo + (hi - lo) / 2;
        if (nums[lo] == target) return lo;
        if (nums[hi] == target) return hi;
        if (nums[mid] == target) return nums[mid];

        if (nums[mid] > target && nums[lo] < nums[mid] && nums[hi] < nums[mid]
                || nums[mid] < target && (nums[lo] > target || nums[hi] < target)) return -1;

        return 100;
    }

    public static int searchq(int[] A, int target) {
        int n = A.length;
        int lo=0,hi=n-1;
        // find the index of the smallest value using binary search.
        // Loop will terminate since mid < hi, and lo or hi will shrink by at least 1.
        // Proof by contradiction that mid < hi: if mid==hi, then lo==hi and loop would have been terminated.
        while(lo<hi){
            int mid=(lo+hi)/2;
            if(A[mid]>A[hi]) lo=mid+1;
            else hi=mid;
        }
        // lo==hi is the index of the smallest value and also the number of places rotated.
        int rot=lo;
        lo=0;hi=n-1;
        // The usual binary search and accounting for rotation.
        while(lo<=hi){
            int mid=(lo+hi)/2;
            int realmid=(mid+rot)%n;
            if(A[realmid]==target)return realmid;
            if(A[realmid]<target)lo=mid+1;
            else hi=mid-1;
        }
        return -1;
    }

